package model;

import java.beans.PropertyChangeEvent;
import java.beans.PropertyChangeListener;

import listenersupport.PropertyListenerSupport;
import parser.PagesParser;
import parser.PagesParserFactory;
import parser.PagesParserInterface;

public class PageModel implements PageModelInterface{

	private PagesParserInterface parser;
	private PropertyListenerSupport propertyListenerSupport = new PropertyListenerSupport();
	private int pageId, pageNumber;
	private String task;
	private boolean answer, mathEditor, submitButton, graph;

	public PageModel(int newPageNumber) {
		parser = PagesParserFactory.getParser();
		pageNumber = newPageNumber;
	}

	@Override
	public void parse() {
		setTask(parser.getTaskByIndex(pageNumber));
		setAnswer(parser.getAnswerByIndex(pageNumber));
		setMathEditor(parser.getMathEditorByIndex(pageNumber));
		setGraph(parser.getGraphByIndex(pageNumber));
		setPageId(parser.getPageIdByIndex(pageNumber));
	}

	@Override
	public void addPropertyChangeListener(PropertyChangeListener aListener) {
		propertyListenerSupport.addElement(aListener);    
    }

	@Override
	public String getTask() {
		return task;
	}

	@Override
	public void setTask(String newTask) {
		String oldTask = task;
		task = newTask;
		propertyListenerSupport.notifyAllListeners(new PropertyChangeEvent(this, "task", oldTask, task));
	}

	@Override
	public boolean getAnswer() {
		return answer;
	}

	@Override
	public void setAnswer(boolean newAnswer) {
		boolean oldAnswer = answer;
		answer = newAnswer;
		propertyListenerSupport.notifyAllListeners(new PropertyChangeEvent(this, "answer", oldAnswer, answer));
	}

	@Override
	public boolean getMathEditor() {
		return mathEditor;
	}

	@Override
	public void setMathEditor(boolean newMathEditor) {
		boolean oldMathEditor = mathEditor;
		mathEditor = newMathEditor;
		propertyListenerSupport.notifyAllListeners(new PropertyChangeEvent(this, "mathEditor", oldMathEditor, mathEditor));
	}

	@Override
	public boolean getGraph() {
		return graph;
	}

	@Override
	public void setGraph(boolean newGraph) {
		boolean oldGraph = graph;
		graph = newGraph;
		propertyListenerSupport.notifyAllListeners(new PropertyChangeEvent(this, "graph", oldGraph, graph));
	}

	@Override
	public boolean getSubmitButton() {
		return submitButton;
	}

	@Override
	public void setSubmitButton(boolean newSubmitButton) {
		boolean oldSubmitButton = submitButton;
		submitButton = newSubmitButton;
		propertyListenerSupport.notifyAllListeners(new PropertyChangeEvent(this, "submitButton", oldSubmitButton, submitButton));
	}

	@Override
	public int getPageId() {
		return pageId;
	}

	@Override
	public void setPageId(int newPageId) {
		int oldPageId = pageId;
		pageId = newPageId;
		propertyListenerSupport.notifyAllListeners(new PropertyChangeEvent(this, "pageId", oldPageId, pageId));
	}

}

